    return (
        <header>
            <Logo/>
            <nav>
                <a href="/">Sobre</a>
                <a href="/">SafeKids</a>
                <a href="/">Contato</a>
                <div>
                    <span> <Link> Log In </Link></span>
                    <div> <Link></Link>Sign Up</div>
                </div>
            </nav>
        </header>
     );
}
 
export default Header;
